import styled from "styled-components";
import Logo from '../Logo';
import NavBar from "../NavBar";
import IconesNavBar from "../IconesNavBar";
import Pesquisa from "../Pesquisa";
import Input from "../Input";



function Header() {
    return (
        <HeaderContainer>
            <Icons>
               <Pesquisa/>
               <IconesNavBar />
            </Icons>
            <Logo />
            <NavBar />
            
        </HeaderContainer>
    )
}




export default Header
